import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)
const actions = {
    SendTodo(a,b){
        console.log(a,b)
    }
}

const mutations = {}

const state = {}


const store = new Vuex.Store({
    actions,
    mutations,
    state
})

export default store
